script: |
  super -f text -I q13083.spq | sort > q13083.out

inputs:
  - name: q13083.spq
    data: |
      SELECT col1, - 96 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 BETWEEN + 50 AND - col0 + - 80;
  - name: tab1

outputs:
  - name: q13083.out
    data: |
      14	-96
      47	-96
      5	-96
